import { BrowserRouter, Route, Routes } from 'react-router-dom';

import HomePage from './pages/HomePage';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<HomePage />} />
        {/* <Route path='/detail/:id' component={DetailPage} />
        <Route path='/cart' component={DetailPage} /> */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
